import React from 'react';
import Header from '../components/Header'; // Corrija o caminho para um nível acima
import Message from '../components/Message'; // Corrija o caminho para um nível acima
import GetStartedButton from '../components/GetStartedButton'; // Corrija o caminho para um nível acima
import ImageSection from '../components/ImageSection'; // Corrija o caminho para um nível acima

function Home() {
  return (
    <div className="home">
      <Header />
      <div className="messages">
        <Message text="Welcome to Sharing Tables!" isBold />
        <Message text="Discover amazing people through a love of food." />
        <Message text="Find restaurants, make reservations, and connect with those who share your culinary tastes." />
        <Message text="Shall we begin this delicious journey together?" />
      </div>
      <GetStartedButton />
      <ImageSection />
    </div>
  );
}

export default Home;
